import React from 'react';
import { Link } from 'react-router-dom';
import homeImg from '../../home.png';
import profileImg from '../../profile.png';
import writeImg from '../../write.png';
import './HomePage.css';

function HomePage() {
    const recipes = [
        { id: 1, title: 'ÎëêÎ∂ÄÏ°∞Î¶º Ìô©Í∏àÎ†àÏãúÌîº', author: 'ÏñëÎã®Ï£ºÎ∂ÄÎßò', imgSrc: '/path/to/image1.png' },
        { id: 2, title: 'Í≥ÑÎûÄÎ≥∂ÏùåÎ∞•(ÏïÑÎÇ®ÏÑ± Î†àÏãúÌîº)', author: 'Ï¥àÎ≥¥Ï£ºÎ∂Ä', imgSrc: '/path/to/image2.png' },
        // Ï∂îÍ∞Ä Î†àÏãúÌîº Ïπ¥Îìú Ï†ïÎ≥¥Î•º Ïó¨Í∏∞Ïóê Ï∂îÍ∞Ä
    ];

    return (
        <div className='container'>
            <div className='title-box'>
                <h1 className='ft-big'>ÎÇòÏùò Ï∑®Ìñ•Ï†ÄÍ≤© Î†àÏãúÌîºüî´</h1>
            </div>
            <div className='search-box'>
                <input type='text' placeholder='Î†àÏãúÌîº Í≤ÄÏÉâÌïòÍ∏∞' className='search-input' />
            </div>
            <div className='card-container'>
                {recipes.map(recipe => (
                    <Link to={`/recipe/${recipe.id}`} key={recipe.id} className='recipe-card'>
                        <img src={recipe.imgSrc} alt={recipe.title} className='recipe-img' />
                        <div className='recipe-info'>
                            <p className='recipe-title'>{recipe.title}</p>
                            <p className='recipe-author'>{recipe.author}</p>
                        </div>
                    </Link>
                ))}
            </div>
            <footer className='home-footer'>
                <Link to='/home'>
                    <div className='footer-imgbox'>
                        <img src={homeImg} className='home-img' />
                        <p className='ft-toosmall'>Ìôà</p>
                    </div>
                </Link>
                <Link to='#'>
                    <div className='footer-imgbox'>
                        <img src={profileImg} className='home-img' />
                        <p className='ft-toosmall'>MY</p>
                    </div>
                </Link>
                <Link to='#'>
                    <div className='footer-imgbox'>
                        <img src={writeImg} className='home-img' />
                        <p className='ft-toosmall'>Í∏ÄÏì∞Í∏∞</p>
                    </div>
                </Link>
            </footer>
        </div>
    );
}

export default HomePage;
